    y = a[1]
    c = [c for c in [m, n] if c != 0][0]
    p.append([x, y])
    for i in range(0, abs(c)):
        if x < b[0]: x += 1
        if x > b[0]: x -= 1
        if y < b[1]: y += 1
        if y > b[1]: y -= 1
        p.append([x, y])
    return [p, [m, n]]
        
